import React from 'react';
import ProgressBar from './ProgressBar'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'


class Skills extends React.Component{
    constructor(props) {
        super (props);
        this.state = {
            items : [
                {
                    id:0,
                    label: 'Python',
                    percent: '100%',
                    years: '5 years'

                },
                 {
                    id: 1,
                    label: 'Java',
                    percent: '100%',
                    years: '5 years'

                },
                {
                    id: 2,
                    label: 'Git',
                    percent: '80%',
                    years: '5 years'

                },
                 {
                    id: 3,
                    label: 'C/C++',
                    percent: '80%',
                    years: '4 years'

                },
                {
                    id: 4,
                    label: 'HTML/CSS',
                    percent: '40%',
                    years: '2 years'

                }

            ]
        }
    }

    makeItems = (items) => {
        return items.map(item => {
            return <ProgressBar className = "" label={item.label} percent = {item.percent} years = {item.years} />
        })
    }

    render() {
        return (
        <Container fluid = {true} className = "skills" >
            <Row className = "justify-content-center">
                <Col lg={8} md={10} sm={11} xs={12}>
                    <h5 className = "skills-heading font-weight-bolder">Some Things I Am Good At</h5>
                    <br/>
                </Col>
            </Row>
            <Row className="justify-content-center">
                <Col lg = {4} md = {5} sm = {8} xs = {8}>
                    <ProgressBar className="" label={this.state.items[0].label} percent={this.state.items[0].percent} years={this.state.items[0].years} />
                </Col>

                <Col lg={4} md={5} sm={8} xs={8}>
                    <ProgressBar className="" label={this.state.items[1].label} percent={this.state.items[1].percent} years={this.state.items[1].years} />
                </Col>
            </Row>

            <Row className="justify-content-center">
                <Col lg={4} md={5} sm={8} xs={8}>
                    <ProgressBar className="" label={this.state.items[2].label} percent={this.state.items[2].percent} years={this.state.items[2].years} />
                </Col>

                <Col lg={4} md={5} sm={8} xs={8}>
                    <ProgressBar className="" label={this.state.items[3].label} percent={this.state.items[3].percent} years={this.state.items[3].years} />
                </Col>
            </Row>

        </Container>

        );
    }

}

export default Skills;
